var maxDistance = function(grid) {
	let arr1 = [];
	let arr0 = [];
	for (let i = 0; i < grid.length; i++) {
		for (let j = 0; j < grid[i].length; j++) {
			if (grid[i][j] === 1) arr1.push([i, j]);
			else arr0.push([i, j]);
		}
	}
	if (arr0.length == 0 || arr1.length == 0) return -1;
	let map0 = {}
	for (let j = 0; j < arr0.length; j++) {
		map0[j] = arr0[j];
	}
	// console.log(map0)
	let caled = {}
	let kk = '';

	function expend1(step1) {
		for (let i = 0; i < arr1.length; i++) {
			for (let key in map0) {
				let v=map0[key];
				// kk = `${i}${key}`;
				// if (!caled[kk]) caled[kk] = Math.abs(arr1[i][0] - map0[key][0]) + Math.abs(arr1[i][1] - map0[key][1]);
				if (Math.abs(arr1[i][0] - v[0]) + Math.abs(arr1[i][1] - v[1]) === step1) {
					// console.log(`before delete when [len=${step1}] ==> key:${key}; xy:${ map0[key]}; len:${Object.keys(map0).length}`)
					delete map0[key];
				}
			}
		}
		if (!Object.keys(map0).length) return step1;
		return expend1(step1 + 1);
	}
	return expend1(1);
};
